import { PipelineToolbar } from './toolbar';
import { PipelineUI } from './ui';
import { SubmitButton } from './submit';

function App() {
  return (
    <div className="h-full flex flex-col" style={{ backgroundColor: '#f9fafb' }}>
      {/* Header */}
      <header className="flex-shrink-0 bg-white border-b border-gray-200 px-4 py-3 flex items-center justify-between">
        <div className="flex items-center gap-3">
          <h1 className="text-lg font-semibold text-gray-900">Pipeline Builder</h1>
          <span className="text-xs text-gray-500 bg-gray-100 px-2 py-1 rounded">
            v0.0.1
          </span>
        </div>
        <SubmitButton />
      </header>

      {/* Toolbar */}
      <PipelineToolbar />

      {/* Canvas */}
      <PipelineUI />
    </div>
  );
}

export default App;
